import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import { AmplifyAuthenticator, AmplifySignIn } from '@aws-amplify/ui-react';
import './App.css';
import MakeTask from './components/make_task';
import CatalogPage from './components/CatalogPage';
import TextDetailPage from './components/TextDetailPage';

function App() {
  return (
    <div className="App">
      <Router>
        <AmplifyAuthenticator>
          <AmplifySignIn
            slot="sign-in"
            usernameAlias="email" // Set to "username" if you want to use username instead of email
            hideSignUp
          />
          <Routes>
            <Route path="/" element={<CatalogPage />} />
            <Route path="/make-task" element={<MakeTask />} />
            <Route path="/text-detail/:index" element={<TextDetailPage />} />
          </Routes>
        </AmplifyAuthenticator>
      </Router>
    </div>
  );
}

export default App;
